import styled from "styled-components";
import img from '../../../img/cloud.svg';


export const Cloud = styled.div`
  background-image: url(${img});
  background-repeat: no-repeat;
  background-size: contain;
  width: 52px;
  height: 50px;
  z-index: 300;

`

export default Cloud;
